  [],\n\t\"revision_timestamp\": \"2016-07-27T22:19:28.611646\",\n\t\"name\": \"plant-community-structure-of-the-bluejoint-meadow-habitat-for-the-western-prairie-fringed-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Western Prairie Fringed Orchid (Platanthera
  praeclara) is classified as a Threatened plant species under both federal and state
  law in Iowa. One of the approximately 25 populations for this species occurs in
  the Bluejoint Meadow Wildlife Area in Polk County, Iowa.  The objective of this
  study was to characterize the plant community in which the Platanthera praeclara
  population occurs. This could assist with efforts to identify other areas of suitable
  habitat in the vicinity of Bluejoint Meadow Wildlife Area.  Although over 60 plant
  species were detected in 100 quadrats, Platanthera praeclara was not one of the
  detected species. It was observed to be present within a few meters of some of the
  quadrats immediately prior to the sampling effort, but was not of sufficient frequency
  to be captured within even a single quadrat.\",\n\t\"license_title\": \"License
